  \"The City of Austin through the Capital Area Council of Governments (CAPCOG) contracted
  Sanborn Mapping, Inc. to update the City of Austin's planimetric database. The planimetrics
  were created from imagery acquired in Spring 2003 using photogrammetric techniques.nThis
  particular represents the index grid of the delivered data from that contract as
  of the Spring of 2003nThis product is for informational purposes and may not have
  been prepared for or be suitable for legal, engineering, or surveying purposes.
  nIt does not represent an on-the-ground survey and represents only the approximate
  relative location of property boundaries. nThis product has been produced by the
  Communications and Technology Department for the sole purpose of geographic reference.
  nNo warranty is made by the City of Austin regarding specific accuracy or completeness.\",\n\t\"owner_org\":
